import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Button, Typography } from '@mui/material';
import axios from 'axios';
import Login from './Login'
import store from '../App'
import { useContext } from 'react';

const Foodlogs = () => {
    // const[token,setToken]=useContext(store)
    const[usertoken,setUsertoken]=React.useState();
    const [data,setData]=React.useState({
      qty:'',
      Unit:'',
      food:'',
      Calories:'',
      date:''
    })
    const changehandler=e=>{
      setData({...data,[e.target.name]:e.target.value})
    }
    const submitHandler=e=>{
      //setUsertoken(localStorage.getItem(usertoken))
      e.preventDefault();
      axios.post('http://localhost:5000/foodlogs',{
        headers:{
          'x-token': "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyIjp7ImlkIjoiNjQyYmZiMzEyZTk2ZTc0MTlkN2U4ZGYyIn0sImlhdCI6MTY4MDY2Nzk0OSwiZXhwIjoxNjg0MjY3OTQ5fQ.vWFXDWsPSX2NjNQaTSexYkVP6l0KxcCGpelQSS2JGfQ"
        }
      },data)
    }
    return (
      <Box>
        <div>
        <Typography fontWeight={50} sx={{fontSize:{lg:'30px',xs:'20px'}}} mt='50px'textAlign={"center"}>RegisterNow</Typography>
          <TextField
            sx={{
              input:{
                  fontWeight:'700',
                  border:'none',
                  borderRadius:'4px',
                  
              },
              width:{lg:'400px',xs:"350px"},
              backgroundColor:'#fff',
              borderRadius:"40px",
              mx: 'auto',
              ml:60,
              mb:5,
              mt:2,
            textAlign: 'center',
            fontSize: '0.875rem',
            fontWeight: '700'
          }}
            required
            id="outlined-required"
            label="Required"
            type="text"
            onChange={changehandler}
            name="qty"
            placeholder='Quantity eX:1 or 2'
          /><br/>
          <TextField
          sx={{
            input:{
                fontWeight:'700',
                border:'none',
                borderRadius:'4px'
            },
            width:{lg:'400px',xs:"350px"},
            backgroundColor:'#fff',
            borderRadius:"40px",
            mx: 'auto',
            ml:60,
            mb:5,
            mt:1,
          textAlign: 'center',
          fontSize: '0.875rem',
          fontWeight: '700'
        }}
            id="outlined-required"
            label="Required"
            type="text"
            name="Unit"
            onChange={changehandler}
            placeholder='Unit ex:liters or cups or oz'
          /><br/>
          <TextField
          sx={{
            input:{
                fontWeight:'700',
                border:'none',
                borderRadius:'4px'
            },
            width:{lg:'400px',xs:"350px"},
            backgroundColor:'#fff',
            borderRadius:"40px",
            mx: 'auto',
              ml:60,
              mb:5,
              mt:1,
            textAlign: 'center',
            fontSize: '0.875rem',
            fontWeight: '700'
        }}
            id="outlined-password-input"
            label="Foodname"
            type="text"
            name="food"
            placeholder="food"
            onChange={changehandler}
            
          /><br/>
           <TextField
          sx={{
            input:{
                fontWeight:'700',
                border:'none',
                borderRadius:'4px'
            },
            width:{lg:'400px',xs:"350px"},
            backgroundColor:'#fff',
            borderRadius:"40px",
            mx: 'auto',
              ml:60,
              mb:5,
              mt:1,
            textAlign: 'center',
            fontSize: '0.875rem',
            fontWeight: '700'
        }}
            id="outlined-password-input"
            label="calories"
            type="text"
            name="Calories"
            placeholder="calories"
            onChange={changehandler}
            
          /><br/>
           <TextField
          sx={{
            input:{
                fontWeight:'700',
                border:'none',
                borderRadius:'4px'
            },
            width:{lg:'400px',xs:"350px"},
            backgroundColor:'#fff',
            borderRadius:"40px",
            mx: 'auto',
              ml:60,
              mb:5,
              mt:1,
            textAlign: 'center',
            fontSize: '0.875rem',
            fontWeight: '700'
        }}
            id="outlined-password-input"
            label="Date"
            type="text"
            name="date"
            placeholder="dd/yy/mm"
            onChange={changehandler}
            
          /><br/>
          <Box textAlign={'center'} ml={10}>
             <Button variant='contained' ml={40}  sx={{backgroundColor:'#7EC8E3',padding:'150', width:{lg:'400px',xs:"300px"},}} onClick={submitHandler}>Register now</Button><br/>
             <Button variant='contained' mb={3} sx={{backgroundColor:'#7EC8E3',padding:'150',width:{lg:'400px',xs:"300px"},}} href="Login" >Already Registered</Button>
          </Box>
        </div>
      </Box>
    );
  
}

export default Foodlogs
